import React, { Component } from 'react';
import Home from './Home'
import Images from './Images'


export class Body extends Component{
	displayContent =() => {
		var activeTab = this.props.activeTab

		if(activeTab===1)
			return <Home/>
		else 
			return <Images/>

	}
  render(){

    return (this.displayContent());


  }

}


export default Body;
